import{UncategorizedTechnologyHelpModel}from"../../model/help/uncategorized-techology-help-model.min.js";import{Utility}from"../../shared/utility.min.js";import ScriptSeriesLoader from"../../shared/script-series-loader.min.js";import StylesheetSeriesLoader from"../../shared/stylesheet-series-loader.min.js";class UncategorizedTechnologyHelpController{constructor(){this.model=new UncategorizedTechnologyHelpModel,this.stylesheetLoader=StylesheetSeriesLoader,this.stylesheetLoader.add("css/work-experience.min.css"),this.stylesheetLoader.load(),this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"),this.scriptLoader.add("js/vendor/season-reminder.min.js"),this.scriptLoader.load()}static build=async()=>{const e=new UncategorizedTechnologyHelpController;for(;e.scriptLoader.running;)await Utility.sleep(2e3);return e};execute=()=>{const e=this.model.getOthers();for(let t=0;t<e.length;t++){const r=e[t],o=[];o.push(this.createNoTd(t)),o.push(this.createNameTd(r)),o.push(this.createDescriptionTd(r));const s=`<tr>${o.join("")}</tr>`;$("#help-info tr:last").after(s)}this.changeBackgroundColor(),$("body").addClass("loaded")};createTd=e=>`<td class='help-info-cell'>${e}</td>`;createNoTd=e=>{const t=e+1;return this.createTd(`<p style='text-align:center;'>${t}</p>`)};createNameTd=e=>this.createTd(`<p class="work-experience-technology-uncategorized" style="white-space:nowrap;">${e.name}</p>`);createDescriptionTd=e=>this.createTd(`<p>${e.description}</p>`);changeBackgroundColor=()=>{const e=new SeasonReminder;e.seasonInfluence=10,e.remindAll("background-color")}}export{UncategorizedTechnologyHelpController};